<script>
	import { page } from '$app/stores';
	import { user } from '$lib/AppWrite/user.js';
	import { goto } from '$app/navigation';
	import { onMount } from 'svelte';

	let route = 'Calculating ..';

	const calculate = async () => {
		route = (await user.getCurrentSession()) == null ? '/' : '/portal';
		setTimeout(() => {
			goto(route);
		}, 2500);
	};

	onMount(() => {
		calculate();
	});
</script>

<section class="page404">
	<img
		draggable="false"
		src="data:image/gif;base64, "
		alt="Lost in Clouds"
	/>
	<div>
		<h1>Lost in the Clouds?</h1>
		<p>
			It seems like the page you were looking for has taken a detour. But no worries! We're
			recalculating your route and will automatically redirect you to the right destination in just
			a moment. Sit tight, and you'll be back on course shortly!
		</p>
		<h6>{$page.status} - {$page.error.message} | Route: {route}</h6>
	</div>
</section>

